import React, { Component, Fragment } from "react";
import Header from "./components/Header";
import PersonalSalud from "./components/PersonalSalud";

/*import Home from "./components/Home";*/

class App extends Component {
  render() {
    return (
      <Fragment>
      <div>
        <div class="container-fluid row" style="padding-top: 30px">
          <h4 class="mb-4">Agregar nuevo caso <a class="btn text-white" style="background-color: #0796d8;" href="#!"
                                                role="button">
              <i class="fas fa-plus"></i>
          </a></h4>
        </div>
      </div>
      <div class="container-fluid row" style="padding-top: 30px">
        <h4 class="mb-4">Buscar registro</h4>
      </div>
      <div class="input-group input-group-sm" style="padding-top: 0; position: relative; padding-right:100px; padding-left:20px ">
        <input type="text" class="form-control form-control-lg rounde bg-transparent text-black-50"
               placeholder="Type Keywords" aria-label="Type Keywords" aria-describedby="basic-addon2"/>
        <span class="input-group-text border-0" id="basic-addon2"><i
                class="fas fa-search fa-lg" style="color: blue"></i></span>
      </div>
        <Header />
        <PersonalSalud />
      </Fragment>
    );
  }
}

export default App;
